records.addlTxt:
Defendant Jasmine A Robinson in court with attorney Andrew Joel Golden.  Daniel J. Gabler appeared for the State of Wisconsin.  Deputy Court Clerk ssm.  

Defendant changes his plea to GUILTY.  Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty.   Defendant advised that if not a United States Citizen, deportation is possible.  Court found that defendant knowingly, voluntarily and intelligently waived his rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  

Sentencing proceeded.  Statements by the State, defense and defendant.  Defendant sentenced to serve 4 MONTHS in the House of Correction.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 1 YEAR.
Conditions:
*  Pay restitution in the amount of $1048.00 to Pick and Save or, if not paid, convert to a civil judgment; cash bail on deposit to be applied; 
*  Perform 20 hours of community service;
*  Maintain absolute sobriety;
*  Pay all costs and surcharges or, if not paid, convert to a civil judgment.

If the defendant successfully completes probation and commits no new violations of the law, the Court will grant expungement.  Notice of Right to Seek Postconviction Relief received and filed.
